import React from 'react';

import './LoginScreenComp.css';

import { Link } from 'react-router-dom';

const LoginScreenComp = () => {
	return (
		<div className="loginscreen">
			<div className="login-container">
				<i class="fas fa-user-circle" />
				<h2 className="login-title">Login</h2>
				<label className="login-labels">Username</label>
				<input type="text" onChange={e => console.log(e.target.value)} />
				<label className="login-labels">Password</label>
				<input type="password" onChange={e => console.log(e.target.value)} />
				<button className="login-btn" onClick={console.log('Submitted!')}>
					Sign In
				</button>
				<p className="register-link">
					Don't have an account? <Link to="/register">Sign Up!</Link>
				</p>
			</div>
		</div>
	);
};

export default LoginScreenComp;
